  { author: 'Tooty', time: 'Today at 6:00PM', text: 'Nice blog post' },];

ReactDOM.render(
  <div className="ui container comments">
    <CommentDetail author="Tooty" time="Today at 6:00PM" text="Nice blog post" />
  </div>,
  document.querySelector('#root'),
